As the Shadow War ended, hundreds of civilizations were devastated. It is up to the Interstellar Alliance, with the help of the Rangers, to rebuild what the great war destroyed and to hold peace among the worlds of the ISA.

In the year 2265, David Martel (Dylan Neal), a Ranger, is given the command of a twenty-year-old Ranger starship, the Liandra, and is asked to escort a Valen-class cruiser to a secret location carrying several diplomats, including Ambassador G&amp;#039;Kar (Andreas Katsulas). However, upon arrival, the two craft are attacked on behalf of an unknown, mysterious, and ancient force known only as The Hand whose lethal power is far greater than any previously known to Earth or any other world in the Interstellar Alliance.
